import React,{Component} from "react";
import {Col, Row, Form, FormGroup, Label, Button, ModalBody, ModalFooter, Input} from "reactstrap";
import Translate from "../../Translate";
import jwt from "jwt-simple";

// const AddContact = ({ id, props }) => {

class AddContact extends Component {
    handleInputChange(key, value) {
        let new_value = {}
        new_value[key] = value
        this.props.setModalValues(new_value)
    }
    handelClick(){
        if(this.props.user.id){
            this.props.editUser()
        }else{
            this.props.addUser()
        }

    }

    render() {
        let user = this.props.user
        return (
            <React.Fragment>
                <ModalBody>
                    <Row>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="firstName"><Translate name="firstname"/></Label>
                                <input
                                    className="form-control"
                                    type="text"
                                    id="firstName"
                                    onChange={event => this.handleInputChange("firstname", event.target.value)}
                                    value={user.firstname}
                                    required
                                />
                            </FormGroup>
                        </Col>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="lastName"><Translate name="lastname"/></Label>
                                <input
                                    className="form-control"
                                    type="text"
                                    id="lastName"
                                    onChange={event => this.handleInputChange("lastname", event.target.value)}
                                    value={user.lastname}
                                />
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="username"><Translate name="username"/></Label>
                                <input
                                    className="form-control"
                                    type="text"
                                    id="username"
                                    onChange={event => this.handleInputChange("username", event.target.value)}
                                    value={user.username}
                                    required
                                />
                            </FormGroup>
                        </Col>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="password"><Translate name="password"/></Label>
                                <input
                                    className="form-control"
                                    type="password"
                                    id="password"
                                    onChange={event => this.handleInputChange("username", event.target.value)}
                                    value={user.password}
                                    required
                                />
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="position"><Translate name="position"/></Label>
                                <Input type="select" id="position" onChange={event => this.handleInputChange("position", event.target.value)}>
                                    {this.props.positions.map((item, key) => {
                                        return <option value={item.id} key={key}>{item.name}</option>
                                    })}
                                </Input>
                            </FormGroup>
                        </Col>
                        <Col md={6}>
                            <FormGroup>
                                <Label for="active"><Translate name="active"/></Label>
                                <Input type="select" id="active"  onChange={event => this.handleInputChange("active", event.target.value)}>
                                    <option value="0">Այո</option>
                                    <option value="1">Ոչ</option>
                                </Input>
                            </FormGroup>
                        </Col>
                    </Row>

                </ModalBody>
                <ModalFooter>
                    <Button color="primary" type="submit" onClick={this.handleClick}>
                        <Translate name="add"/>
                    </Button>
                </ModalFooter>
            </React.Fragment>
        );
    }

};

export default AddContact;
